import "../src/earth.js";
export default class Earth extends Component {
  render() {
    return (
      <div>
        <script src="https://cdnjs.cloudflare.com/ajax/libs/three.js/108/three.min.js" />
        <canvas id="earth"></canvas>
      </div>
    );
  }
}
